import React from 'react';
import { View, Text, StyleSheet, StyleProp, ViewStyle, TextStyle } from 'react-native';

interface FolderProps {
  containerStyle?: StyleProp<ViewStyle>; // Стиль для контейнера
  textStyle?: StyleProp<TextStyle>; // Стиль для тексту
  text: string;
}

const Folder: React.FC<FolderProps> = ({ containerStyle, textStyle, text }) => {
  return (
    <View style={containerStyle}> {/* Використовуємо обидва стилі */}
      <Text style={textStyle}>{text}</Text>
    </View>
  );
};


export default Folder;
